import React from "react";

function add(x,y){
let sum=x+y;
return sum;
}
function sub(x,y){
let sub=x-y;
return sub;
}
function mult(x,y){
let mult=x*y;
return mult;
}
function  div(x,y){
let div=x/y;
return div;
}
function Indexchallege5(){
    return( <>    
   <ul>
    <li>sum of two number is {add(5,7)}</li>
     <li>sub of two number is {sub(8,4)}</li>
     <li>div of two number is {div(40,5)}</li>
     <li>mult of two number is {mult(5,6)}</li>
   </ul>
    </>)
   
}
export default Indexchallege5;
